import React from "react";
import "./css/OurServices.css";

const OurServices = () => {
  return (
    <div className="our__services">
      <div className="our__services__header">
        <h1>Our Services</h1>
      </div>
      <div className="services__offered__container"></div>
    </div>
  );
};

export default OurServices;
